ble benefits. Popular frying whole grains and a variety of dried fruits mix crushed herbs health board, Chaodou, roasted chestnuts and so on.<br></p>','Roasting means','',''), ('77','1','干果/炒货','<p><span xss=removed>炒货是指植物果实经过晾晒，烘干，油炸等加工方法制成的供人们闲暇时食用的一类休闲食品。如</span><a target=\"_blank\" href=\"http://baike.baidu.com/view/74900.htm\" xss=removed>瓜子</a><span xss=removed>、</span><a target=\"_blank\" href=\"http://baike.baidu.com/subview/38215/5066691.htm\" xss=removed>蚕豆</a><span xss=removed>、花生、核桃、</span><a target=\"_blank\" href=\"http://baike.baidu.com/subview/38355/9763561.htm\" xss=removed>栗子</a><span xss=removed>，豆类等，用干净的干果和专用颗粒“</span><a target=\"_blank\" href=\"http://baike.baidu.com/subview/7007189/7151625.htm\" xss=removed>炒砂</a><span xss=removed>”（搜）作介质直接炒制，或者在炒制前浸泡添加各种味料炒制。炒货一般含有丰富的营养，常吃对人体有相当的好处．目前流行炒制五谷杂粮和各种干果药材混合粉碎养生膳，炒豆，</span><a target=\"_blank\" href=\"http://baike.baidu.com/subview/778570/778570.htm\" xss=removed>糖炒板栗</a><span xss=removed>等。</span><br></p>','干果/炒货','',''), ('57','2','Women\'s Dresses','Women\'s Dresses','Women\'s Dresses','',''), ('71','1','台式电脑','<p>台式电脑<br></p>','台式电脑','台式电脑','台式电脑'), ('71','2','Desktop PC','<p>Desktop PC<br></p>','Desktop PC','','');
