INSERT INTO `information_description` VALUES ('6','2','Delivery Information','<p>Delivery InformationDelivery InformationDelivery InformationDelivery InformationDelivery Information<br></p>'), ('6','1','配送条款','<p>\r\n 配送信息配送信息配送信息配送信息<span xss=\"removed\">配送信息配送信息配送信息配送信息</span><span xss=\"removed\">配送信息配送信息配送信息配送信息</span><span xss=\"removed\">配送信息配送信息配送信息配送信息</span><span xss=\"removed\">配送信息配送信息配送信息配送信息</span><span xss=\"removed\">配送信息配送信息配送信息配送信息</span></p>\r\n'), ('8','1','加盟合同','<p xss=\"removed\"><span xss=\"removed\">一、合同各方<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">授权方：<span lang=\"EN-US\">______</span>科技发展有限公司（以下简称“甲方”）<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">法定授权人：<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">法定地址：上海市<span lang=\"EN-US\">____</span>路<span lang=\"EN-US\">____</span>大厦<span lang=\"EN-US\">a</span>座<span lang=\"EN-US\">12a </span>邮编：<span lang=\"EN-US\">______<o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">被授权方：<span lang=\"EN-US\">___________________________________ </span>（以下简称“乙方”）<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">法定代表人：<span lang=\"EN-US\">_____________<o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">法定地址：<span lang=\"EN-US\"> __________________________________<o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">甲乙双方经协商，就乙方为其在特定区域内<span lang=\"EN-US\">__</span>经营甲方的“<span lang=\"EN-US\">______</span>”专卖店一事，达成如下协议：<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">二、合同期限<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">本合同加盟期限为<span lang=\"EN-US\">________</span>年<span lang=\"EN-US\">__</span>月<span lang=\"EN-US\">__</span>日至<span lang=\"EN-US\">________</span>年<span lang=\"EN-US\">__</span>月<span lang=\"EN-US\">__</span>日止。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">三、加盟经营<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">1</span><span xss=\"removed\">、 甲方特此授权乙方为 区域内成为“<span lang=\"EN-US\">______</span>”的特许经销商。经此授权后，甲方在该区域内将不再授予任何其它企业、个人以同类经销权。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">2</span><span xss=\"removed\">、 在授权期内，甲方在向乙方提供“<span lang=\"EN-US\">______</span>”品牌产品时，甲方应保证所提供的产品质量符合国家有关标准、品级与实物相符，并保证货源供应。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">3</span><span xss=\"removed\">、 乙方保证在签订本合同<span lang=\"EN-US\">7</span>日内需向甲方支付加盟费人民币贰万元<span lang=\"EN-US\">/</span>店。每个加盟店首次从甲方购进“<span lang=\"EN-US\">______</span>”品牌的产品，按供货价不少于 万元。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">4</span><span xss=\"removed\">、甲方保证向中国大陆内各加盟方交付的产品保持统一的零售标价。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">5</span><span xss=\"removed\">、甲方将“<span lang=\"EN-US\">______</span>”品牌产品按零售标价的<span lang=\"EN-US\">4</span>—<span lang=\"EN-US\">4.5</span>折售予乙方（详细见配货单），不论首次购货还是后续购货乙方应在提货时一次性支付货款。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">6</span><span xss=\"removed\">、如果出现乙方采用以假汇票、假支票的方式骗取货物的情况，甲方除追究乙方的违约责任外，将依法请求司法机关追究相关人员、单位的刑事责任。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">7</span><span xss=\"removed\">、乙方从甲方购进产品后，如因质量问题或货物品种组合问题，可在自进货之日起五天内，向甲方调换产品，但不得退货。调换时乙方须保持原产品完好、包装齐备、标签没有损坏。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">8</span><span xss=\"removed\">、合同到期后，若乙方决定不再销售“<span lang=\"EN-US\">______</span>”品牌产品，在乙方保证产品完好、包装齐备、标签无损坏、未超过保质期的前提下，可将现存的“<span lang=\"EN-US\">______</span>”产品退还给甲方。甲方按供货价的<span lang=\"EN-US\">6</span>折回收退还的产品。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">三、营业场地、店面装饰与配置<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">1</span><span xss=\"removed\">、 乙方应在双方共同商定的区域内开展经营和促销活动。乙方不得在未经甲方许可的情况下擅自将自己的经营活动和促销活动扩大到区域之外。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">2</span><span xss=\"removed\">、加盟店店铺设在乙方处，或由乙方自行选定其它场所并报甲方批准。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">3</span><span xss=\"removed\">、为维护公司品牌形象的统一性，加盟店由甲方免费进行装饰设计，装修工程由甲方工程部报价并施工，乙方应按工程预算支付装修工程款并协助办理在当地施工的相关手续。甲方收到工程款项后\r\n日内将店铺交付乙方使用。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">4</span><span xss=\"removed\">、加盟店内的营业所需（包括：设备、装置、用具、招牌等）由总部统一进行设计制作。对于营运必需的包装材料、促销礼品、提货袋及其它附属材料、消耗品，加盟店需使用总部配备的产品。\r\n上述所涉及的费用由加盟商承当。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">四、促销与广告<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">1</span><span xss=\"removed\">、甲方在授权期内，将协助乙方进行“<span lang=\"EN-US\">______</span>”品牌的形象设计，并向乙方适时提供相应的产品宣传资料、标识、招贴物品等。甲方可根据乙方的经营状况和要求，帮助乙方进行特定时间和区域的产品促销和推广活动。（具体事宜可另议）<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">2</span><span xss=\"removed\">、甲方进行 “<span lang=\"EN-US\">______</span>”品牌的整体宣传活动乙方必须配合，相关的“<span lang=\"EN-US\">______</span>”品牌的产品进行促销、推广计划和广告设计由甲方提供，乙方遵照执行。甲方对于促销活动所涉产品在供货价基础上按照促销折让的比例给与优惠。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">3</span><span xss=\"removed\">、乙方单独进行“<span lang=\"EN-US\">______</span>”品牌有关的宣传、广告活动时，应事先告知甲方，取得甲方同意后方可进行。相关广告形象设计须经过甲方审核或由甲方提供。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">4</span><span xss=\"removed\">、乙方须承担自行组织促销活动产生促销让利和费用。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">五、培训与指导<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">1</span><span xss=\"removed\">、为使加盟店能良好经营，在开业前及本合同执行期间，甲方应向加盟店传授必要的知识和经营技术。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">2</span><span xss=\"removed\">、加盟店在开业前应派遣店主或两名可以代行承担的职工，参加甲方规定的教育研修，获得经营公司店铺必要的知识和技术。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">3</span><span xss=\"removed\">、开业后，如甲方有研修指示，乙方也必须按指示要求派员再次参加前项规定的进修教育，获得必需的知识和技术。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">4</span><span xss=\"removed\">、加盟店承担前来培训的旅差费用。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">5</span><span xss=\"removed\">、加盟店开业前后三天，作为店铺营运入轨期，甲方应向加盟店派遣人员进行开业和经营指导。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">6</span><span xss=\"removed\">、乙方必须参加甲方组织的年度销售会议及临时经营者会议。甲方应提前四周通知开会日期。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">7</span><span xss=\"removed\">、除经营者会议外，甲方将不定期向乙方派遣市场负责人进行指导和培训。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">六、商标、服务标志及相关权利<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">1</span><span xss=\"removed\">、本合同所涉及的所有商标、服务标志及其相关权利的所有权均归属于甲方。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">2</span><span xss=\"removed\">、甲方承诺在本合同执行期间，乙方加盟店可以使用甲方商标、服务标志及表示这些标志、记号、样式、标签和招牌。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">3</span><span xss=\"removed\">、乙方不得在加盟店以外使用甲方的所有商标和服务标志。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">4</span><span xss=\"removed\">、乙方应在经营中向顾客提供良好的服务，维护甲方品牌的声誉、信誉和良好形象。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">5</span><span xss=\"removed\">、双方在此明确，乙方取得的是在授权期内、在指定区域内甲方商标、服务标志的使用权和产品的经销权，这并不意味着甲方商标、品牌及商誉等相关知识产权的任何转让、许可。合同到期或提前终止后，乙方不得以任何借口继续使用“<span lang=\"EN-US\">______</span>”品牌，或以“<span lang=\"EN-US\">______</span>”品牌经销商的名义从事任何商业活动。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">七、竞争限制<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">1</span><span xss=\"removed\">、在合同期内，乙方如有意获得其所在省市区域的“<span lang=\"EN-US\">______</span>”特许经营代理权，可在同等条件下优先取得甲方的特许代理权。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">2</span><span xss=\"removed\">、为表示对甲方合作的诚意，在合同期内，如甲方推出“<span lang=\"EN-US\">______</span>”之外的其它新系列商品和服务，乙方有优先代理权。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">3</span><span xss=\"removed\">、乙方在授权期内，不得再接受任何其它企业、个人的授权或委托，在加盟店内代理、经销其它品牌的产品。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">4</span><span xss=\"removed\">、乙方未经甲方许可，不得将甲方授予的经销权以各种形式转让给任何第三方。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span xss=\"removed\">八、服务质量控制<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">1</span><span xss=\"removed\">、为维护加盟店售出商品品种和服务的一致性，提高公司形象，乙方加盟店的运营方法必须遵守总部提供的经营手册规定的要求和标准。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">2</span><span xss=\"removed\">、凡甲方有新产品推出，乙方必须按照最低配货量或以上的数量购入，并将新产品及时上架销售。<span lang=\"EN-US\"><o></o></span></span></p><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\">3</span><span xss=\"removed\">、乙方须按照甲方要求，对顾客购买金额达到规定标准时，给与“玫瑰卡”会员资格和相应的折扣优惠，做好会员资料信息的登记汇总工作并半年一次定期向甲方提供会员资料信息。凡有新产品上市或产品促销活动乙方应通知所有会员，让会员享受到来自“<span lang=\"EN-US\">______</span>”持续不断的优质服务。甲方将不定期回访