ers can be re-confirmed that the franchise business, it should promptly return the right business franchise. 3, gains and losses that occur during the operation of the above belong to the headquarters to take over the franchise, operating costs for field took the burden generated by the franchise.</p><p>4. The Party hopes to sell at stores or rental shop, you should first inform Party A has priority transferee and the rights of lease.</p><p>5. In which case, the parties may, through consultation, stores alienation and lease price of gold. Negotiation of intent can not be established, the parties may apply for certification or assessment legally binding, the cost borne by the Party.</p><p>XI, termination of the contract</p><p>1, before the expiration of the contract for three months, by mutual agreement, the contract can be updated.</p><p>2, the contract renewal in the preceding paragraph, should be completed one month prior to the expiration of the contract. The two sides signed a new franchise contract for collaborative text.</p><p>3. After the expiration of this contract parties do not intend to continue to cooperate, Party B shall bear the following obligations upon termination of this contract:</p><p>a, pay all fees payable to headquarters;</p><p>b, the return of all operating manuals, confidential and proprietary information;</p><p>c, transfer to Party \"______ Card\" membership registration lists;</p><p>d, restitution, resale or destruction of all with the \"______\" signs and materials for commercial signage;</p><p>e, cancel the \"______\" business registration and registration of names registered in the name</p><p>f, in the original franchise establishments outside the house, equipment, furnishings, etc., to eliminate any \"______\" There are signs of contact;</p><p>g, because the franchise business to the detriment of the interests of a third party, the liability for damages borne by the Party.</p><p>4, Party A franchise activity are liability claims may require recourse Party burden of the compensation.</p><p>Twelve, breach of contract</p><p>1. Any party who fails to perform or not fully fulfill the obligations specified in the terms of the contract, that is a breach of contract, breach by a party shall be liable for breach.</p><p>2, the two sides agreed, for the amount of defaults in the previous 10 per cent of the total Party Business Products retail price provided by Party. Such as breach of contract to the other losses, and losses in excess of the total amount of liquidated gold, the defaulting party shall also be responsible for the excess liability. Breach of contract by the other party in writing within 30 days after the failure is not corrected for correction, the other party the right to terminate the contract and the right to ask for damages.</p><p>XIII, contract disputes</p><p>1. Any dispute arising in the execution of this contract, the two sides should first friendly consultation, the consultation fails, the two sides have the right to file for arbitration to Shenzhen Arbitration Commission.</p><p>Fourth, other</p><p>1, the contract shall become effective on the date the two sides signed and sealed.</p><p>2, the original contract in duplicate, each party holding a copy of each has the same legal effect.</p><p>Party: ______ Ltd. Party B:</p><p>Address: Address:</p><p>Telephone and fax: Telephone and fax:</p><p>Principal Representative (Signature): Trust Representative (Signature):</p>'), ('4','1','概述','<h6>蚂蚁开源是什么？</h6><p>蚂蚁开源是由学习php而诞生的多商家、多语言、单用户，强大的商品、订单管理系统的开源项目，项目中多处借鉴opencart的优点，其特性如下：</p><p>1.多商家：支持商家申请入驻，系统自动算结商家帐户，功能类似淘宝，亚马逊。</p><p>2.多语言：你可以为你的商城订制语言，为外贸提供支持。</p><p>3.单用户：商家、管理员、会员、社区论坛一个帐号，单点登陆同步。</p><p>4.商品管理：商家添加商品后可以在自己商家后台管理商品，系统管理员只能查看或处罚商品，不能操作商品。</p><p>5.订单管理：会员可以为某个订单下的单一商品申请退换服务，而不必整单退换。同样管理员只可以查看订单而不能操作订单，商家在自己后台可以操作订单。</p><h6>蚂蚁开源是由创始人xcalder独立开发的电商项目</h6><h6>蚂蚁开源的理想</h6><p>你是否鄙视过ecshop的商业授权？是否反感过商派的加密代码？或者你忍受了opencart不能很好的支持多商家？又或者是opencart没有开发文档？又或者magento框架太大？是否你早已在意淫着有朝一日能诞生一个免费而又强大到爆的电商项目？那么你久违的OpenAnt来了，它完全免费商业授权，为了推动外贸电商的发展。</p><h6>蚂蚁开源（楚雄蚂蚁开源软件工作室）</h6><p>成立于2016年9月的蚂蚁开源软件工作室是伴随着蚂蚁开源项目而诞生的，它在蚂蚁开源项目开始之后成立是因为我觉得这是一个有价值的项目，并且它需要有一个倡导开源的组织来推动和维护，因为它的诞生并不完美。</p><h6>蚂蚁开源名字之由来</h6><p>其实用这个名字来命名我们的开源电商平台项目，只是因为我们实在找不到一个更好的域名了，偶然之间搜索到了openant.com这个域名，之后把它翻译成了中文，</p><h6>蚂蚁本小正如我们但其力无可量</h6>'), ('4','2','About Us','<h6>Open source is what the ants?</h6><p>Ant open source is to learn php and the birth of more businesses, multi-lingual open source projects, single-user, strong commodity, order management system, learn the advantages of multiple projects opencart of the following characteristics:</p><p>1. more businesses: business support application to enter, the system will automatically calculate the junction merchant account functions like Taobao, Amazon.</p><p>2. Multi-language: You can customize the language of your store, to support foreign trade.</p><p>3. Single user: merchants, administrators, members of the community forum account, single sign-on synchronization.</p><p>4. Commodity Management: business management background can be added after commodity goods, the system administrator can only view their own business or punishment goods, commodities can not be operated.</p><p>5. Order Management: members can apply for an order for a single item returned under the service without having the entire single-returnable. Also administrator can only view orders and orders can not operate, businesses can operate in their own back orders.</p><h6>Ant open source is developed by the founder xcalder independent electricity supplier project</h6><h6>Ideal Ant open source</h6><p>Are you despised ecshop commercial license? Resentment over whether the business school encrypted code? Or you endured opencart not well supported by more businesses? Or is opencart no development documentation? Or magento framework too? Are you already in the obscenity of one day the birth of a free and powerful burst of electricity supplier to the project? Then your long absence OpenAnt come, it is completely free commercial license, in order to promote the development of foreign trade electricity supplier.</p><h6>Ant open source (open source software studio Chuxiong ant)</h6><p>Founded in September 2016 ants studio open source software is accompanied by ants open source project and birth, which was established after the Ant open source project started because I think this is a worthwhile project, and it needs to have a open source advocate organizations to promote and maintain because of its birth is not perfect.</p><h6>The origin of the name of the open source Ant</h6><p>Actually, using this name to name our business platform open source project, just because we can not find a better domain name, and search incidental to openant.com between the domain, and then translate it into Chinese,</p><h6>The small ants but as we have no power amount</h6>'), ('9','1','联系我们','<p></p>\r\n<p></p>\r\n<address>  <strong>地址：</strong><br>中国云南省楚雄市鹿城镇金沙苑11-1-502</address><p></p>\r\n<p></p>\r\n<address><span xss=\"removed\">邮编</span><span xss=\"removed\">：</span></address><p></p>\r\n<p></p>\r\n<address>675000</address><p></p>\r\n<p></p>\r\n<address><span xss=\"removed\">联系人</span><span xss=\"removed\">：</span></address><p></p>\r\n<p></p>\r\n<address>代先生<br><br></address><address><strong>电话：</strong><br>  <a href=\"mailto:#\">1</a>8108780440</address><p></p>\r\n<p></p>\r\n<address><span xss=\"removed\">Email:</span></address><p></p>\r\n<p></p>\r\n<address>xcalder@foxmail.com<br><br></address><p></p>\r\n<p></p>'), ('9','2','联系我们','<address> <strong> Address: &lt;!-- strong--&gt; <br> China Yunnan Chuxiong City, Deer town Sands Court 11-1-502 &lt;!-- address--&gt; <p> &lt;!-- p--&gt;</p><p> &lt;!-- p--&gt;</p><address> <span xss=\"removed\"> Zip &lt;!-- span--&gt; <span xss=\"removed\">: &lt;!-- span--&gt; &lt;!-- address--&gt; <p> &lt;!-- p--&gt;</p><p> &lt;!-- p--&gt;</p><address> 675000 &lt;!-- address--&gt; <p> &lt;!-- p--&gt;</p><p> &lt;!-- p--&gt;</p><address