ust around seven. Guangzhou city many were flooded, water intrusion into the subway station, subway once into the underground river.<br></p>','','','May 10 morning rush hour, Guangzhou thunderstorms locally heavy rain, thunderstorm gust around seven. Guangzhou city many were flooded, water intrusion into the subway station, subway once into the underground river.'), ('72','1','崂山啤酒 五厂 崂山沙子口泉水酿造 500ml*12/箱 部分地区2箱包邮','<p xss=\"removed\">【环球网综合报道】据香港《东方日报》5月9日报道，美国西点军校学员毕业时，有模仿经典历史肖像拍照的传统，而今年16名即将毕业的黑人女学员就拍了一张举起拳头的毕业照。照片惹起社会争议，有人认为此举有违国防部政策，而西点军校已经展开调查。</p><p xss=\"removed\">　　据报道，涉事的16名学员将<img src=\"/image/users/2016/02/02/1/description/201608061108538cSnTRNMpK.jpg\">于本月21日毕业，她们穿上灰色军服，举起右手拳头，站在宿舍楼梯上拍照。照片被上传网络后，有人质疑她们举起拳头是否是为支持近年因一连串美警涉对黑人滥用武力案而兴起的黑人运动“Black Lives Matter”，因此涉嫌违反国防部“执勤时不能参与政治活动”的规条。</p><p xss=\"removed\">　　在本事件惹起社会广泛讨论后，西点军校发言人前日表示学校已经介入调查，目前尚不清楚调查所需时间，以及对涉事学员可能作出的惩罚。</p><p xss=\"removed\">　　认识涉事学员的毕业生杜宾(Mary Tobin)认为，她们此举只是展示团结的方式，无意涉及黑人运动，纯粹在庆祝成功毕业，在似运动队获胜后会抛起头盔一样。</p><p xss=\"removed\">　　据了解，西点军校内7成学员是白人，8成是男性，黑人女学员为数不多。(实习编辑：朱丽娜 审核：谭利娅)</p>','','','崂山啤酒 五厂 崂山沙子口泉水酿造 500ml*12/箱 部分地区2箱包邮'), ('72','2','【环球网综合报道】据香港《东方日报》5月9日报道，美国西点军校学员毕业时，有模仿经典历史肖像拍照的传统，而今年1','<p xss=\"removed\">【环球网综合报道】据香港《东方日报》5月9日报道，美国西点军校学员毕业时，有模仿经典历史肖像拍照的传统，而今年16名即将毕业的黑人女学员就拍了一张举起拳头的毕业照。照片惹起社会争议，有人认为此举有违国防部政策，而西点军校已经展开调查。</p><p xss=\"removed\">　　据报道，涉事的16名学员将于本月21日毕业，她们穿上灰色军服，举起右手拳头，站在宿舍楼梯上拍照。照片被上传网络后，有人质疑她们举起拳头是否是为支持近年因一连串美警涉对黑人滥用武力案而兴起的黑人运动“Black Lives Matter”，因此涉嫌违反国防部“执勤时不能参与政治活动”的规条。</p><p xss=\"removed\">　　在本事件惹起社会广泛讨论后，西点军校发言人前日表示学校已经介入调查，目前尚不清楚调查所需时间，以及对涉事学员可能作出的惩罚。</p><p xss=\"removed\">　　认识涉事学员的毕业生杜宾(Mary Tobin)认为，她们此举只是展示团结的方式，无意<img src=\"/image/users/2016/02/02/1/description/20160806110826LOdKA7x2Hg.jpg\">涉及黑人运动，纯粹在庆祝成功毕业，在似运动队获胜后会抛起头盔一样。</p><p xss=\"removed\">　　据了解，西点军校内7成学员是白人，8成是男性，黑人女学员为数不多。(实习编辑：朱丽娜 审核：谭利娅)</p>','','','【环球网综合报道】据香港《东方日报》5月9日报道，美国西点军校学员毕业时，有模仿经典历史肖像拍照的传统，而今年1'), ('58','2','新的占位产品','<p><img src=\"http://lv.com/image/users/2016/02/02/1/description/